import React from "react";

import ReactDOM from 'react-dom';

import Grid from '@material-ui/core/Grid';

import Footer from "react-footer-comp";

import { IconContext } from "react-icons";

import { SocialIcon } from 'react-social-icons';

import { FaEnvelope } from 'react-icons/fa';

const bottomFooter = () => {
  return (
<div>
    <Footer
        bgColor={"black"}
        textStyle={{ color: "yellow", fontSize: 20, fontFamily: "Michroma"}}
        width={425}
        height={"100px"}
        text={
    <Grid container
            spacing={10}
            direction="row"
            alignItems="center"
            justify="center"
    >
    <IconContext.Provider value={{ color: "blue",
    size: "30px"}}>
    <Grid item lg={5}>
    <FaEnvelope href={"mailto:walkerkeatley@yahoo.com"}>walkerkeatley@yahoo.com</FaEnvelope>
    </Grid>
    </IconContext.Provider>
    <Grid item lg={7}>
        <SocialIcon url="https://twitter.com/blackfalcon_unc" />
        <SocialIcon url="https://www.instagram.com/floyds_fotos/" />
        <SocialIcon url="https://github.com/walkerfloyd1" />
        <SocialIcon url="https://www.linkedin.com/in/walker-floyd-b53182123/" />
    </Grid>
        </Grid>}
        />
</div>
  );
}

export default bottomFooter;
